import React from "react";


const list = [
    {
      id: 'a',
      firstname: 'Robin',
      lastname: 'Wieruch',
      year: 1988,
    },
    {
      id: 'b',
      firstname: 'Dave',
      lastname: 'Davidds',
      year: 1990,
    },
  ];

  const nestedLists = [list, list];

  const User = () => (
    <ul>
      {nestedLists.map((nestedList, index) => (
        <ul key={index}>
          <h4>List {index + 1}</h4>
          {nestedList.map(item => (
            <li key={item.id}>
              <div>{item.id}</div>
              <div>{item.firstname}</div>
              <div>{item.lastname}</div>
              <div>{item.year}</div>
            </li>
          ))}
        </ul>
      ))}
    </ul>
  );

  export default User;
